B.abO=new A.cg([B.j_,"Esta categor\xeda busca garantizar que el sistema de transporte responda a las necesidades de todos los ciudadanos, con especial \xe9nfasis en la equidad de g\xe9nero y la inclusi\xf3n de personas en situaci\xf3n de vulnerabilidad.",B.j0,"Esta categor\xeda se centra en la protecci\xf3n de todos los usuarios del sistema vial, minimizando riesgos y mejorando la respuesta ante incidentes.",B.j1,"Orientada a fomentar una cultura de respeto y responsabilidad en el uso del sistema de transporte.",B.j2,"La categor\xeda de infraestructura eval\xfaa la calidad, cobertura y mantenimiento del entorno f\xedsico destinado a la movilidad urbana sostenible.",B.j3,"Enfocada en la reducci\xf3n del impacto ambiental y la optimizaci\xf3n de recursos.",B.j4,"Esta categor\xeda eval\xfaa la percepci\xf3n y satisfacci\xf3n de los usuarios del sistema de transporte."],t.wD)
